import React from "react";
import "./App.css";
import Appbar from "./component/appbar.js";
import Banner from "./component/banner.js";
import Footer from "./component/footer.js";
import Album from "./component/album.js";

function App() {
  return (
    <div className="App">
      <Appbar />
      <Banner />
      <Album />
      <iframe src="https://cloudodysseyindia-my.sharepoint.com/personal/arpit_patni_cloudodyssey_co/_layouts/15/stream.aspx?id=%2Fpersonal%2Farpit%5Fpatni%5Fcloudodyssey%5Fco%2FDocuments%2FRecordings%2FTraining%20sessions%20for%20SFCC%201%20%26%202%2E%2D20221130%5F124310%2DMeeting%20Recording%2Emp4&ga=1" title="W3Schools Free Online Web Tutorials"
      width="100%" height="300" style="border:none;"
      >First Lecture</iframe>
      <Footer />
    </div>
  );
}

export default App;
